import React from "react";
import { useParams } from "react-router-dom";
import { HomeData } from "../Home";

const Page=()=>{
    const {id}=useParams;
    const data=HomeData[id]

    return(
        <div>
            <img src={data.imgurl} alt="img"/>
            <h1>{data.heading}</h1>
            <p>{data.content}</p>
        </div>
    )
}
